                    <link rel="stylesheet" type="text/css" href="table1template/vendor/perfect-scrollbar/perfect-scrollbar.css" />
                    <link rel="stylesheet" type="text/css" href="table1template/css/util.css" />
                    <link rel="stylesheet" type="text/css" href="table1template/css/main.css" />
                </head>
                <body>

                <Table striped bordered hover>
  <thead>
    <tr>
      <th>#</th>
      <th>First Name</th>
      
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>1</td>
      <td>Mark</td>
    </tr>
   
  </tbody>
</Table>

                    <script src="table1template/vendor/jquery/jquery-3.2.1.min.js"></script>
                    <script src="table1template/vendor/bootstrap/js/popper.js"></script>
                    <script src="table1template/vendor/bootstrap/js/bootstrap.min.js"></script>
                    <script src="table1template/vendor/select2/select2.min.js"></script>
                    <script src="table1template/js/main.js"></script>

                </body>
            </div>
        )
    }
}

